// SnacksCard.js

import axios from 'axios';
import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import Snacks from './Snacks';
import { setSnacksCards } from '../../Redux/slices/SnacksCardSlice';

function SnacksCard() {
  const dispatch = useDispatch();
  const snacksCards = useSelector((state) => state.Snackscard.SnacksCards);

  useEffect(() => {
    if (snacksCards.length === 0) {
      axios
        .get('https://demo5518646.mockable.io/SnacksCard')
        .then((res) => {
          dispatch(setSnacksCards(res.data));
        });
    }
  }, [dispatch, snacksCards]);

  return <Snacks />;
}

export default SnacksCard;
